Element("h5",null,"UML stands for Unified Modeling Language. It\u2019s a rich language to model software solutions, application structures, system behavior and business processes. There are 14 UML diagram types to help you model these behaviors. You can draw UML diagrams online using our software."),o.a.createElement("h3",{className:"heading"}," List of UML Diagram Types"),o.a.createElement("h3",{className:"heading"},"CLASS DIAGRAM"),o.a.createElement("h5",null,"Class diagrams are the main building block of any object-oriented solution. It shows the classes in a system, attributes, and operations of each class and the relationship between each class. In most modeling tools, a class has three parts. Name at the top, attributes in the middle and operations or methods at the bottom. In a large system with many related classes, classes are grouped together to create class diagrams. Different relationships between classes are shown by different types of arrows."),o.a.createElement("h3",{className:"heading"},"COMPENENT DIAGRAM"),o.a.createElement("h5",null,"A component diagram displays the structural relationship of components of a software system. These are mostly used when working with complex systems with many components. Components communicate with each other using interfaces. The interfaces are linked using connectors."),o.a.createElement("h3",{className:"heading"},"Use Case  DIAGRAM"),o.a.createElement("h5",null,"As the most known diagram type of the behavioral UML types, Use case diagrams give a graphic overview of the actors involved in a system, different functions needed by those actors and how these different functions interact. It\u2019s a great starting point for any project discussion because you can easily identify the main actors involved and the main processes of the system. You can create use case diagrams using our tool and/or get started instantly using our use case templates."),o.a.createElement("h3",{className:"heading"},"SEQUENCE  DIAGRAM"),o.a.crea